import './App.css';
import React from 'react';
import SearchBar from './components/SearchBar';
import WinsByTimeGraph from './components/WinsByTimeGraph';

function App() {
  return (
    <div className="App">
      <h1>Tommy's Cool Chess App</h1>
      <div>
        <SearchBar />
      </div>
      <div>
        <WinsByTimeGraph />
      </div>
    </div>
  );
}

export default App;
